<html:script language="javascript">
    var inputDatePattern = 'Y-m-d' ;
    var separatorString = 'to';
    $( document ).ready(function() {

        $("#loader-1").hide();
        empId = location.href[location.href.length-1];
        dates = $('#startDates').find(":selected").text().split(" "+separatorString+" ");
        startDate_timesheet = dates[0]+" 00:00:00";
        endDate_timesheet   = dates[1]+" 00:00:00";

        clientId  =     "";
        clientSecret  = "";
        clientUrl     = "";
        successUrl  = "";
        ajaxURL = "/orangehrm-4.3.1/symfony/web/index.php/leave/viewLeaveEntitlements";
        var timeSheetStatus = $('#timesheet_status').find('h2').text();
        if(timeSheetStatus == 'Status: Approved'){

            $('.syncToggl').hide();
        } else {
            $('.syncToggl').show();
        }

    });


    function ajaxSyc() {
        $("#loader-1").show();

        $.ajax({
                type: "POST",
                url: ajaxURL,
                data: {
                    'employee_Id':employeeId,
                    'startTime': startDate_timesheet,
                    'endTime': endDate_timesheet,
                    'timeFormat': inputDatePattern,
                    'timeZone': 'GMT'+formatTimeZone()
                },
                contentType: "application/x-www-form-urlencoded",

                success: function (msg, status, jqXHR) {

                    $("#loader-1").hide();
                    msg = JSON.parse(msg);
                    msgCode = msg.statusCode;
                    if (msgCode != null) {
                        if (msgCode == 101) {
                            displayMessages('error',msg.description );
                        } else if (msgCode == 102) {

                            displayMessages('success', msg.description);
                            setTimeout(function () {
                                location.reload();
                            }, 2000);

                        }
                    } else {
                        showErrorMsg();
                    }

                },
                error: function (XMLHttpRequest, textStatus, errorThrown) {
                    $("#loader-1").hide();
                    console.log(errorThrown);
                    showErrorMsg();
                }
            });
    }

    function startSyc() {
        $("#loader-1").show();

    $.ajax({

        type: "POST",
        url: clientUrl,


        data: {
            'grant_type': 'client_credentials',
            'client_id': clientId,
            'client_secret': clientSecret
        },
        contentType: "application/x-www-form-urlencoded",


        success: function (msg, status, jqXHR) {

            try {

                msg = $.parseJSON(jqXHR.responseText);

            } catch (err) {
                console.log(err);
                showErrorMsg();
            }

            $.ajax({
                type: "POST",
                url: successUrl,
                beforeSend: function (xhr) {

                    xhr.setRequestHeader("Authorization", "Bearer " + msg.access_token);
                },

                data: {

                    'employee_Id':employeeId,
                    'startTime': startDate_timesheet,
                    'endTime': endDate_timesheet,
                    'timeFormat': inputDatePattern,
                    'timeZone': 'GMT'+formatTimeZone()
                },
                contentType: "application/x-www-form-urlencoded",

                success: function (msg, status, jqXHR) {

                    $("#loader-1").hide();
                    msgCode = msg.statusCode;
                    if (msgCode != null) {
                        if (msgCode == 101) {
                            displayMessages('error',msg.description );
                        } else if (msgCode == 102) {

                            displayMessages('success', msg.description);
                            setTimeout(function () {
                                location.reload();
                            }, 2000);

                        }
                    } else {
                        showErrorMsg();
                    }

                },
                error: function (XMLHttpRequest, textStatus, errorThrown) {
                    $("#loader-1").hide();
                    console.log(errorThrown);
                    showErrorMsg();
                }
            });

        },
        error: function (XMLHttpRequest, textStatus, errorThrown) {
            $("#loader-1").hide();
            console.log(errorThrown);
            showErrorMsg();
        }


    });

    }

    function showErrorMsg(){
        displayMessages('error','Unable To Sync With Toggl' );
        setTimeout(function () {
            $('#msgDiv').remove();
        }, 3000);

    }

</html:script>
